const GLOWTWO_NOT_IN_CART = "GLOWTWO_NOT_IN_CART";

const ACTION_GLOWTWO_NOT_IN_CART = () => {
  return {
    type: GLOWTWO_NOT_IN_CART,
    payload: {
      name: "Children's Haircut"
    }
  };
};

export default ACTION_GLOWTWO_NOT_IN_CART;
